import React from 'react'
import { useState } from 'react'
import './Card.css'
import more from './more.png'
import { Link } from 'react-router-dom'
import { supabase } from '../client'


const Card = (props) =>  {

  return (
      <div className="Card">
          <Link to={'edit/'+ props.id}><img className="moreButton" alt="edit button" src={more} /></Link>
          <div className='inlineTextLbl'>Name:</div><div className='inlineTextTxt'>{props.fullName}</div>
          <div className='inlineTextLbl'>Employee ID:</div>
          <div className='inlineTextTxt'>{props.empId}<br></br></div>
          <div className='inlineTextLbl'>Department: </div>
          <div className='inlineTextTxt'>{props.dept}<br></br></div>
          <div className='inlineTextLbl'>Designation: </div>
          <div className='inlineTextTxt'>{props.role}<br></br></div>
          <div className='inlineTextLbl'>Email ID: </div>
          <div className='inlineTextTxt'>{props.email}</div>
      </div>
  );
};

export default Card;
